"""
In a town, there are n people labelled from 1 to n.  There is a rumor that one of these people is secretly the town
 judge.

If the town judge exists, then:

The town judge trusts nobody.
- Everybody (except for the town judge) trusts the town judge.
- There is exactly one person that satisfies properties 1 and 2.

You are given trust, an array of pairs trust[i] = [a, b] representing that the person labelled a trusts the person
 labelled b.

If the town judge exists and can be identified, return the label of the town judge.  Otherwise, return -1.
"""
from typing import List, Tuple


def find_judge(n: int, trust: List[Tuple[int, int]]) -> int:
    """
    :param n: people labelled from 1 to n (1 indexed)
    :param trust: list of (person_a, person_b) representing person_a trusts person_b
    :return: town judge if exists, else -1
    """
    net_trust_count = [0] * n

    for person_a, person_b in trust:
        net_trust_count[person_a - 1] -= 1
        net_trust_count[person_b - 1] += 1

    for person_i, person_net_trust in enumerate(net_trust_count, start=1):
        if person_net_trust == n - 1:
            return person_i

    return -1


